import Form from "./Form";
import List from "./List";
import React, { useState, useEffect } from "react";

function Contacts() {
  return (
    <div>
      <h1
        style={{
          color: "GrayText",
        }}
      >
        Contacts
      </h1>
      <List />
      <Form />
    </div>
  );
}

export default Contacts;
